                            to = "mainpage"
                            spy = {true}
                            smooth = {true}
                            offset = {-70}
                            duration={500}>
                                Main Page
                        </Link>


                        <Link 
                            activeClass = "active"
                            to = "education"
                            spy = {true}
                            smooth = {true}
                            offset = {-70}
                            duration={1000}>
                                Education
                        </Link>

                        <div>
                            <MainPage/>
                            <Education/>   
                        </div>

                </div>



                )
            }
        }
